import React from "react";

import StopWatch from "./componets/Stopwatch";

function App() {
  return (
    <div>
      <div>
        <header>
          <h1>Hey user, start Tasking!</h1>
        </header>
        <StopWatch />
      </div>
    </div>
  );
}

export default App;
